  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0112360 includes chemical,
  discrete sample, physical and profile data collected from WAKATAKA MARU in the North
  Pacific Ocean from 2004-09-24 to 2004-10-08 and retrieved during cruise PACIFICA_49WA20040924
  and WK0409. These data include DISSOLVED INORGANIC CARBON, HYDROSTATIC PRESSURE,
  NITRATE + NITRITE CONTENT (CONCENTRATION), PHOSPHATE, SALINITY, SILICATE and WATER
  TEMPERATURE. The instruments used to collect these data include CTD, Coulometer
  for DIC measurement and bottle. These data were collected by Tsuneo Ono of National
  Research Institute of Fisheries Science and Hiroaki Saito of Tohoku National Fisheries
  Research Institution - Hachinohe as part of the PACIFICA_49WA20040924 data set.nnPACIFICA
  (PACIFic ocean Interior CArbon) was an international collaborative project for the
  data synthesis of ocean interior carbon and its related parameters in the Pacific
  Ocean. The North Pacific Marine Science Organization (PICES), Section of Carbon
  and Climate (S-CC) supported the project.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
